import { Helmet } from "react-helmet";
import { NOMBRETIENDA } from "../../assets/js/CONST";

function Elhelmet({ title }) {
	console.debug( title );
	return (
		<Helmet>
			<title>{title} || { NOMBRETIENDA }</title>
		</Helmet>
	);
}
export default Elhelmet;
